  false,\n\t\"url\": null,\n\t\"notes\": \"The present report describes surface water
  relations in a lowland hardwood wetland in the Upper Mississippi Alluvial Valley
  (MAV). Water regimes were examined by sampling habitats within the Mingo Basin (hereafter,
  Mingo Swamp) in southeastern Missouri weekly from February 1981 to May 1983. These
  relations were examined in light of past and present management activities within
  Mingo Swamp and to provide a historical perspective on lowland hardwood wetland
  communities in the Upper MAV.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
